Though not the first to sport a “helmet of bobbed brunette hair,” Brooks was the epitome of “the disdainful flapper of the 1920's,” famous for “blatantly flaunting the accepted sexual and societal roles of women.” She once said “I have a gift for enraging people, but if I ever bore you, it'll be with a knife.”
 
Born in a tiny Kansas town in 1906, dad was a lawyer, mom a pianist. Vivian Vance (Ethel Merman) was a childhood friend. At 16 she joined a dance company, went to NYC. She joined the Ziegfeld Follies and was “discovered” while dancing  in George White’s (1924) “Scandals.” The “legendary actress” was independent, spoke her mind, & had a rebellious nature. In NYC her “personal behavior” caused Brooks trouble: "Within a month, my wearing apparel had got me kicked out of 2 hotels.”
 
She began making silent films around 1925, but left in 1928 after a Paramount executive “had turned down her request for a raise.” She went to work in Europe and proved “she was an actress with an enduring talent.” In 1929 Brooks played ‘Lulu’ in Pabst's Pandora's Box, an “amoral temptress” that the actress was compared to for the rest of her life.
 
Home from Europe, her “disputes with the Hollywood executives continued & she appeared only in minor roles.” Brooks filed for bankruptcy then retired from acting in 1938, having made 24 films (many are lost.) Brooks had 2 bad marriages and no kids; at some point she indulged in an affair with the founder of CBS who “secretly provided her with a yearly pension for the rest of her life.” In the late 30’s she made an unsuccessful bid for a comeback.
 
Brooks began writing around 1943, though she spent the 40’s working odd jobs in NYC, including stints as a “sales girl at Saks 5th Avenue, gossip columnist & radio commentator.” She moved to Rochester in 1956 at the behest of the curator of the Eastman House museum. She “studied films, including 7 of her own,” and focused on writing. Her memoir, Lulu in Hollywood, was published in 1985 to great acclaim.
 
She died in 1985, of a heart attack at 78. For “nearly 30 years had lived in retirement in a small 1 bedroom apartment, sick, poor, proud & alone.”";}i:134;a:1:{s:14:"comments_count";i:1;}i:135;a:1:{s:11:"likes_count";i:35;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEukaVtAMbK";}i:137;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118873749_633591130677814_8945823223045891134_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=hSDMWsB7AkoAX-xrlTM&oh=106b958fe35e1e66cf29e87cdebd447f&oe=5F7B55BD";}i:138;a:1:{s:4:"type";s:7:"sidecar";}i:139;a:1:{s:8:"owner_id";i:1504620129;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391008306226524358";}i:144;a:1:{s:10:"short_code";s:11:"CEukWLro_DG";}i:145;a:1:{s:12:"created_time";i:1599250423;}i:146;a:1:{s:7:"caption";s:10:"#kos⚜️";}i:147;a:1:{s:14:"comments_count";i:1;}i:148;a:1:{s:11:"likes_count";i:6;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEukWLro_DG";}i:150;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118732074_110394300796526_3075152355410813206_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=-3LUhySBguMAX-jhWM8&_nc_tp=18&oh=12accf6bc7f1756dc481b991be4970ba&oe=5F7C2CC4";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:7331927204;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391008203489091204";}i:157;a:1:{s:10:"short_code";s:11:"CEukUsAAx6E";}i:158;a:1:{s:12:"created_time";i:1599250410;}i:159;a:1:{s:7:"caption";s:118:"HAPPY BIRTHDAY @Beyonce 🧿 #DestinyandBeyond  Elle April 2003 by @gilles_bensimon /  Dior Couture  ss2003 collection";}i:160;a:1:{s:14:"comments_count";i:1;}i:161;a:1:{s:11:"likes_count";i:17;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEukUsAAx6